// src/components/svg/BackgroundPattern.js
import React from 'react';

const BackgroundPattern = () => (
  <svg className="absolute inset-0 w-full h-full" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 400 400">
    <defs>
      <pattern id="gridPattern" patternUnits="userSpaceOnUse" width="40" height="40">
        <path d="M 40 0 L 0 0 0 40" fill="none" stroke="#4ecca3" strokeWidth="0.5" strokeOpacity="0.2"/>
      </pattern>
      <linearGradient id="fadeGradient" x1="0%" y1="0%" x2="100%" y2="100%">
        <stop offset="0%" style="stop-color:#4ecca3;stop-opacity:0.1"/>
        <stop offset="100%" style="stop-color:#4ecca3;stop-opacity:0"/>
      </linearGradient>
    </defs>
    <rect width="100%" height="100%" fill="url(#gridPattern)"/>
    <rect width="100%" height="100%" fill="url(#fadeGradient)"/>
  </svg>
);

export default BackgroundPattern;
